// Node module: apim-ui

'use strict';

/* Services */

var subscriptions = angular.module('apim.subscriptions');

subscriptions.factory('Subscriptions', ['$resource',
  function($resource){
    return $resource('proxy/orgs/:orgId/environments/:envId/:spaces/:spaceId/subscriptions', {}, {
      query: {method:'GET', params:{orgId: '@orgId', envId: '@envId'}, isArray: true}
    });
  }]);

